const REPO   = 'wr98-code/new-zeromeridian';
const TOKEN  = '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';
const BRANCH = 'main';
const BASE   = 'https://api.github.com';
const H = {
  'Authorization': `token ${TOKEN}`,
  'Content-Type':  'application/json',
  'User-Agent':    'push87-zm',
};

async function sha(path) {
  const r = await fetch(`${BASE}/repos/${REPO}/contents/${path}?ref=${BRANCH}`, {headers:H});
  if (!r.ok) return null;
  return (await r.json()).sha ?? null;
}

async function push(path, b64) {
  const s = await sha(path);
  const body = { message: `push87: rombak total — ${path.split('/').pop()}`, content: b64, branch: BRANCH };
  if (s) body.sha = s;
  const r = await fetch(`${BASE}/repos/${REPO}/contents/${path}`, {method:'PUT',headers:H,body:JSON.stringify(body)});
  if (!r.ok) throw new Error(`FAIL ${path}: ${JSON.stringify(await r.json())}`);
  console.log(`  ✅ ${path.split('/').pop()}`);
}

const FILES = {
  "src/components/layout/AppShell.tsx": "",
  "src/components/layout/ZMSidebar.tsx": "",
  "src/components/layout/Topbar.tsx": "",
  "src/components/shared/GlobalStatsBar.tsx": "",
  "src/components/shared/GlassCard.tsx": "",
  "src/components/shared/MetricCard.tsx": "",
  "src/pages/Dashboard.tsx": "",
  "src/index.css": "",
};

async function main() {
  console.log('\n🔥 push87 — TOTAL ROMBAK\n');
  for (const [p, b] of Object.entries(FILES)) {
    process.stdout.write(`  → ${p.split('/').pop()}\n`);
    await push(p, b);
  }
  console.log(`\n✅ push87 done! ${Object.keys(FILES).length} files`);
  console.log('🌐 https://new-zero.vercel.app\n');
  console.log('Fixes:');
  console.log('  ✓ Layout sistem bener — no overlap, no kepotong');
  console.log('  ✓ $$ bug fixed — formatCompact tidak double dollar');  
  console.log('  ✓ Warna clean — biru elegan, no cyan norak');
  console.log('  ✓ Sidebar logo full tinggi, terlihat semua');
  console.log('  ✓ Topbar kiri mengikuti sidebar width');
}

main().catch(e => { console.error('❌', e.message); process.exit(1); });
